import React from 'react'

export default class CharacterCreater extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      initiative: null,
      dexterity: null,
      name: null,
      portrait: null,
    }
  }

  render(){
    return(
      <form>
        <label htmlFor="Name">
          Name:
          <input type="text" value="Name"/>
        </label>
        <label htmlFor="Initiative">
          Initiative:
          <input type="text" value="Initiative"/>
        </label>


      </form>
    )
  }
}
